To achieve the desired functionality of turning on a light when the door is open,
you can create a blueprint that triggers an automation whenever the `door_sensor`
(controls whether the door opens) changes to 'ON.' The automation will then switch off the specified light 
target once the door has been opened.

### 1. Define Entities

- **`DoorSensor`**: This sensor will detect when the door is open.
- **`LightSwitch`**: This entity will control if the light should turn on or off based on the state of the `door_sensor`.

### 2. Create Blueprint

Here's a blueprint using Python and the Home Assistant programming language, which uses the `light_switch` to control the `DoorSensor`.

```python
import json

from homeassistant.core import State
from homeassistant.helpers.entity import Entity
from homeassistant.helpers.entity_registry import EntityRegistry

from homeassistant.const import STATE_ON, STATE_OFF, STATE_CLOSED

# Define your entities here:
door_sensor = EntityRegistry.get_or_create_entity(
    'sensor.door', 'DoorSensor', config_entry=EntityRegistry.get_config('sensor.door')
)
light_switch = [EntityRegistry.get_entity(STATE_ON, 'LightSwitch'), ] # One or more LightSwitches to turn on/off

# Define the blueprint
blueprint = f'''
{
  '$schema': 'https://json-schema.org/draft-07/schema',
  'title': 'TurnOnLightWhenDoorOpensBlueprint',
  'type': 'object',
  'properties': {
    'door_sensor': {
      'type': 'binary_sensor',
      'name': 'DoorSensor',
      'state_topic': f'entities/{door_sensor.entity_id}',
      'entity_id': 'light_switch.0'
    }
  },
  'actions': [
    {
      'action': 'turn_on',
      'payload': { 'device_state': 'closed' }
    },
    {
      'action': 'turn_off',
      'payload': {}
    }
  ],
  'state_topic': f'homeassistant/door_sensor',
  'entity_id': 'light_switch.0'
}
'''

# Print the blueprint to the console
print(blueprint)

try:
    import voluptuous as vol
except ImportError:
    from homeassistant.helpers import validate_config_schema

config = json.loads(blueprint)
validate_config_schema(config, {'door_sensor', 'light_switch'})

# Add an entity for DoorSensor
DoorSensor = EntityRegistry.get_entity(STATE_ON, 'DoorSensor')
door_sensor.add_automation(
    {
        'entity_id': DoorSensor.entity_id,
        'name': 'DoorSensor',
        'action': 'turn_on'
    }
)

# Define actions to switch off the light when the door is closed
actions = [
    # When the door is closed, turn off the first LightSwitch
    {'action': 'turn_off', 'payload': {}},
]

if 'light_switch' in DoorSensor:
    entity_id = DoorSensor.entity_id
else:
    action = None
    light_switch_actions = [{'action': 'turn_on'}]
    for light_switch in light_switch:
        if door_sensor.has_action(light_switch.action, action):
            # Turn on the light switch
            light_switch.turn_on(light_switch.action)
            break
        else:
            actions.append(
                {
                    'action': f'toggle_off_{light_switch.name}',
                    'payload': {}
                }
            )

    if actions:
        DoorSensor.add_automation(actions)

# Save the configuration changes to the database
door_sensor.save_entity()
```

### 3. Testing

To test the automation, you can simulate door opening and closing using a voice assistant or device that supports interacting with Home Assistant.

For instance, you could have a simple voice assistant named 'Alexa' open and close a speaker connected to your home assistant. When Alexa turns on the light switch, it will turn on the speaker.

### 4. Integration

This blueprint integrates well with the `light_switch` entity for controlling the lights that can be triggered by external events.

Remember, this is just an example blueprint. You may need to adjust the parameters based on your specific use case and device capabilities.

**Note**: Make sure you have a reliable way to test the automation in production before deploying it to a live system.

